import { useNavigate } from "react-router-dom";

export function RegisterPage() {
  // funcoes para navegar e voltar
  // navigate('/login')
  // navigate(-1)// voltar no historico
  const navigate = useNavigate();

  const back = () => {
    navigate(-1);
  };
  return (
    <div className="login">
       <div className="login-logo">
          <img
             src="https://agilitymonitoramento.com.br/static/media/logo-pj-center.effeb7ae.svg"
             alt="MdLockLogin App"
          />
       </div>

       <div className="login-right">
          <h1>Acessar Sistema</h1>

          <div className="login-loginInputEmail">
             <MdEmail />
             <input
                type="email"
                placeholder="Digite um email"
                value={email}
                onChange={e => setEmail(e.target.value)}
             />
          </div>

          <div className="login-loginInputPassword">
             <MdLock />
             <input
                placeholder="Digite sua senha"
                type={show ? "text" : "password"}
                value={password}
                onChange={e => setPassword(e.target.value)}
             />
             <div className="login-eye">
                {show ? (
                   <HiEye
                      size={20}
                      onClick={handleClick}
                   />
                ) : (
                      <HiEyeOff
                         size={20}
                         onClick={handleClick}
                      />
                   )}
             </div>
          </div>

          <button onClick={Login}>Entrar</button>

          <h4>NÃ£o tenho conta!</h4>

          <button onClick={RegisterPage}>Cadastrar</button>

       </div>
    </div>
  )
}
